import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div className="grid-container">
        <div className="item-1">1</div>
        <div className="item-1">2</div>
        <div className="item-1">3</div>
        <div className="item-1">4</div>
        <div className="item-1">5</div>
        <div className="item-1">6</div>
        <div className="item-1">7</div>
        <div className="item-1">8</div>
        <div className="item-1">9</div>
      </div>
    );
  }
}

export default Home;
